// this defines the function "get_score" that we use to access the table
// it contains its own error checking, and means that we can pass age = 35
// to get at the first line in the array.
double referenceValuesGet_score(int sex, int age, int ethrisk)
{
    if ( (age < minAge || age > maxAge) || !(sex == 0 || sex == 1) || (ethrisk < 1 || ethrisk > 9) )
    {
	// raise an exception
	printf("An attempt was made to access QRiskReferenceScores with invalid parameters: (%d, %d, %d)\n", sex, age, ethrisk);
	exit(1);
    }
    double score = referenceValues2011[age - minAge][sex][ethrisk - 1][5];
    return ((int)((score * 100)+0.5))/100.0;
}

int referenceValuesSize_of_array()
{
    return sizeof(referenceValues2011)/(sizeof(double) * (2*9*11) );
}

int qriskAge(int sex, int ethrisk, double score) {
	int i;
	for (i = minAge; i <= maxAge; i++) {
		if (referenceValuesGet_score(sex, i, ethrisk) > score)
			break;
	}
	// if over the value of an 84 year old, return -1
	if (referenceValuesGet_score(sex, maxAge, ethrisk) < score)
		i= -1;
	return i;
}
